import classes from "./../../css/Dialogs.module.css";
import { NavLink } from 'react-router-dom';


const Message = (props) => {
	return (
		<p>{props.message}</p>
	);
}

const Messages = (props) => {

	let MessageArr = [
		{ id: 0, message: "lorem" },
		{ id: 1, message: "Lorem ipsum dolor sit amet." },
		{ id: 3, message: "Lorem ipsum dolor sit amet consectetur adipisicing elit. Modi, nobis mollitia?" }
	]
	
	return (
		<div>
			<h2>Чат</h2>
			<div>
				<Message message={MessageArr[0].message} />
				<Message message={MessageArr[1].message} />
				<Message message="Lorem ipsum dolor sit amet consectetur adipisicing elit. Modi, nobis mollitia?" />
			</div>
		</div>
	);
}

export default Messages;
